import React from 'react';
import './style.css'

function LateralBar(){
    return (
        <div className="lateral-bar">
            <img src="../assets/entrada.png" alt="Entrada" />
            <h3 className="texto-lateral"> Entrada</h3>
            <br />
            <img src="../assets/hoje.png" alt="Hoje" />
            <h3 className="texto-lateral"> Hoje</h3>
        </div>
    )
}
export default LateralBar;
